import React from "react";
import { Route } from "react-router-dom";

import CollectionsOverviewContainer from "../../components/collection-overview/collection-overview.component";
import ProductDetailsPage from "../review-product/review-product-page.component";
import ReviewProductPage from "../review-product/review-product-page.component";

import "./productpage.styles.css";

const ProductPage = ({ match, history }) => {
  console.log("AQQQ", history);

  return (
    <div className="shop-page">
      <Route path={`${match.path}`} component={CollectionsOverviewContainer} />
      <Route
        path={`${match.path}/:collectionId`}
        component={ReviewProductPage}
        //render={props => (
        //<CollectoinPageWithSpinner isLoading={!isCollectionsLoaded} {...props}/>
        //)}
      >
        {console.log("mira Aqui", `${match.path}/:collectionId`)}
      </Route>
    </div>
  );
};

export default ProductPage;
